import React from "react";
import CardImage from "../cardImage/CardImage";
import CardInfo from "../cardInfo/CardInfo";
import CardTitle from "../cardTitle/CardTitle";
import "./card.css";

function Card() {
  return (
    <div className="card">
      <div className="card-body">
        <CardTitle />
        <CardImage />
        <CardInfo />
      </div>
    </div>
  );
}

export default Card;
